DROP TABLE IF EXISTS `inventory_product_stock`;
CREATE TABLE `inventory_product_stock`
(
    `id`                   bigint(20)     NOT NULL AUTO_INCREMENT COMMENT '主键',
    `sku_code`             varchar(20)    NOT NULL COMMENT '商品sku编号',
    `sale_stock_quantity`  decimal(18, 6) NOT NULL COMMENT '销售库存',
    `saled_stock_quantity` decimal(18, 6) NOT NULL COMMENT '已销售库存',
    `create_time`          datetime       NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
    `update_time`          datetime       NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
    PRIMARY KEY (`id`),
    UNIQUE KEY `uk_sku_code` (`sku_code`)
) ENGINE = InnoDB COMMENT ='商品库存表';

DROP TABLE IF EXISTS `product_stock_log`;
CREATE TABLE `product_stock_log`
(
    `id`                             bigint(20) NOT NULL AUTO_INCREMENT,
    `sku_code`                       varchar(20)         DEFAULT NULL COMMENT '商品sku编号',
    `order_id`                       varchar(50)         DEFAULT NULL COMMENT '订单编号',
    `origin_sale_stock_quantity`     decimal(18, 6)      DEFAULT NULL COMMENT '原始的销售库存',
    `origin_saled_stock_quantity`    decimal(18, 6)      DEFAULT NULL COMMENT '原始的已销售库存',
    `deducted_sale_stock_quantity`   decimal(18, 6)      DEFAULT NULL COMMENT '扣除后的销售库存',
    `increased_saled_stock_quantity` decimal(18, 6)      DEFAULT NULL COMMENT '增加后的已销售库存',
    `status`                         tinyint(4) NOT NULL DEFAULT '1' COMMENT '状态，1-已扣减；2-已释放',
    `create_time`                    datetime   NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
    `update_time`                    datetime   NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
    PRIMARY KEY (`id`),
    KEY `idx_sku_code_order_id` (`sku_code`, `order_id`)
) ENGINE = InnoDB COMMENT ='库存扣减日志表';

DROP TABLE IF EXISTS `undo_log`;
CREATE TABLE `undo_log`
(
    `id`            bigint(20)   NOT NULL AUTO_INCREMENT,
    `branch_id`     bigint(20)   NOT NULL,
    `xid`           varchar(100) NOT NULL,
    `context`       varchar(128) NOT NULL,
    `rollback_info` longblob     NOT NULL,
    `log_status`    int(11)      NOT NULL,
    `log_created`   datetime     NOT NULL,
    `log_modified`  datetime     NOT NULL,
    PRIMARY KEY (`id`),
    UNIQUE KEY `ux_undo_log` (`xid`, `branch_id`)
) ENGINE = InnoDB;


